import SearchBar from "./SearchBar"

export default function Group({currentUser,groupName,groupId}){

    const navgate=useNavigate()

    return(
        <div>
            <h1 className="text-lg mt-8">{groupName}</h1>
            <SearchBar></SearchBar>
            <button className="hover:bg-darkPurple rounded-md bg-purple px-4  text-white mb-8  mt-2">add member</button> 

            <button className="hover:bg-darkPurple rounded-md bg-purple px-4  text-white mb-8  mt-2"><img src="/goBack.svg"></img></button>
        </div>
    ) 
}
